import { Link } from "react-router-dom";
import ImgSlider from "../../components/ImgSlider/ImgSlider";

const Landing = () => {
  return (
    

    <div name="landing" className="w-full h-screen bg-amber-500">
        <h2 className="flex px-2 py-2 text-2xl"> HuntTravel </h2>
      <div className="max-w-[9000px] mx-auto px-8 flex flex-col justify-center h-full">
        
        <ImgSlider className="justify-center p-3" />
        <h1 className="text-center text-4xl mh-3"> SEARCH YOUR ACTIVITY </h1>
        
        <Link to="/home">
          <button className="text-white top-6 border-2 px-6 py-3 my-2 flex items-center hover:bg-[#87581a] hover:border-[#87581a]"> Welcome </button>
        </Link>
      </div>
    </div>
    
  );
};

export default Landing;
